import React from "react";
import "../../../Styles/Pages/ContactSales/SalesLast.scss";

function SalesLast() {
  return (
    <div className='salesLast'>
      <h1>Our Parteners</h1>
      <p>
        Empowering forward-thinking companies from startups to global
        superbrands
      </p>
    </div>
  );
}

export default SalesLast;
